description:
ovie Info: Mickey Virus is 2013 Hindi Thriller comedy released on October 25, 2013 and written &amp; directed by Saurabh Varma. Mickey Virus is produced by DAR Motion Pictures in association with Trilogic Digital Media Limited &amp; Awesome Films Pvt. Ltd. The film features Manish Paul, Elli Avram, Manish Choudhary, Puja Gupta, and Varun Badola as main characters. The film got positive reviews on its release.


